B.a0q=new A.fO(null,"Quer apostar e ganhar dinheiro? Ent\xe3o, **aqui n\xe3o \xe9 o seu lugar.**\n\n\nN\xe3o sabemos nada de odds, tips, handicaps e outros n\xfameros sem alma. Para n\xf3s, **esporte n\xe3o tem nada a ver com isso.** Ou voc\xea torce para o cart\xe3o amarelo? S\xe9rio mesmo?\n\nEsporte \xe9 paix\xe3o, conex\xe3o e divers\xe3o. Este \xe9 um espa\xe7o pra aqueles que vivem o time de cora\xe7\xe3o. Pra aqueles que sentem o jogo na pele, que tem seu lugar da sorte e n\xe3o abrem m\xe3o dele. **Feito para torcedores de verdade.**\n\nNo **Quer Valer**, cada aposta \xe9 um duelo entre f\xe3s, \xe0s vezes amigos, outras somente advers\xe1rios mesmo. \xc9 botar f\xe9 no seu time, lan\xe7ar um desafio e, quando o outro aceitar, poder dizer: **\u201cT\xe1 valendo!\u201d**\n\n**O pr\xeamio pode ser uma cerveja**, duas, ou at\xe9 mesmo uma caixinha. Ao final da partida, o derrotado paga (ou n\xe3o, cada um com a sua consci\xeancia) e o vencedor recebe o pr\xeamio em casa. E, claro, o direito de comandar a resenha.\n\nEnt\xe3o, se \xe9 isso que voc\xea procura, seja bem-vindo. O **QV** \xe9 uma comunidade de f\xe3s de esportes, que celebra a boa e velha rivalidade. Porque o que vale mesmo n\xe3o \xe9 o placar, mas as hist\xf3rias que ficam de um jogo entre amigos.\n\nE a\xed, **quer valer?**")
